pragma solidity 0.8.4;

contract LithiumAdmin {
    mapping(address => bool) private maintainers;
    mapping(address => uint256) private maintainerIndexes;
    address[] private maintainersList;

    constructor() {
        maintainers[msg.sender] = true;
        maintainersList.push(msg.sender);
    }

    modifier onlyMaintainer() {
        require(isMaintainer(msg.sender), "Address is not maintainer");
        _;
    }

    function addMaintainer(address candidate) public onlyMaintainer {
        require(!maintainers[candidate], "Candidate already is maintainer");
        maintainers[candidate] = true;
        maintainerIndexes[candidate] = maintainersList.length;
        maintainersList.push(candidate);
    }

    function removeMaintainer(address maintainer) public onlyMaintainer {
        require(maintainers[maintainer], "Address is not a maintainer");

        maintainers[maintainer] = false;
        maintainersList[maintainerIndexes[maintainer]] = maintainersList[
            maintainersList.length - 1
        ];
        maintainerIndexes[
            maintainersList[maintainersList.length - 1]
        ] = maintainerIndexes[maintainer];
        maintainersList.pop();
        delete maintainerIndexes[maintainer];
    }

    function isMaintainer(address maintainer) public view returns (bool) {
        return maintainers[maintainer];
    }

    function getMaintainers() public view returns (address[] memory) {
        return maintainersList;
    }
}
